&lt;p&gt;Sketchbook History #2 - 1973.&lt;br /&gt;
During the summer after I graduated from High School I got blown up in a boat explosion.  My recuperation took place at my parent's home in Virginia.  I got a job life guarding at a local pool inside a country club.  I used my off time to continue drawing.  A frequent visitor to the pool allowed me to draw her sunbathing.  Sunbathers are great models for artists of course since they sit still for long periods of time.  She was no exception. &lt;br /&gt;
I was 18 when I drew this.&lt;br /&gt;
&lt;br /&gt;
Drawing by Marty Coleman of The Napkin Dad Daily&lt;/p&gt;

