&lt;p&gt;Buy your ticket today for the Finest Art Raffle of the Year!&lt;br /&gt;
Limited Tickets Remaining!&lt;br /&gt;
 &lt;br /&gt;
One Ticket, One Treasure! The Collectors Choice raffle is this Sunday, September 19.&lt;br /&gt;
Gallery doors will open at 11am, raffle begins at 1pm.&lt;br /&gt;
 &lt;br /&gt;
All ticket holders go home with a piece of art generously donated by the creating artists.&lt;br /&gt;
&lt;br /&gt;
Tickets are $150.00. Visit the gallery or go to &lt;a href="http://www.restonarts.org/CollectorsChoice" rel="nofollow"&gt;www.restonarts.org/CollectorsChoice&lt;/a&gt; to preview the artwork.&lt;br /&gt;
&lt;br /&gt;
Your participation in this fundraiser directly supports GRACEs mission of enriching community life by promoting involvement and excellence in contemporary visual arts.  &lt;br /&gt;
 &lt;br /&gt;
If you cannot be here in person but would like to participate, call the gallery to discuss the option of a volunteer proxy to work your wish list!&lt;br /&gt;
 &lt;br /&gt;
As an extra bonus, Mon Ami Gabi is offering a $10 discount to all ticket holders, good through September 30.&lt;br /&gt;
&lt;br /&gt;
